import React, { useState, useEffect } from "react";
import { default as NumberFormat } from 'react-number-format';
import { FaSkull } from "react-icons/fa";
import { FiRefreshCw } from "react-icons/fi";
import { TiWarning } from "react-icons/ti";
import { FaCheck } from "react-icons/fa";
import { BsClockFill } from "react-icons/bs";

import Moment from 'moment';

import api from '../../services/api.js';
import "./styles.css";

export default function Paises() {
    Moment.locale('PT-BR');

    const [pais1, setPais1] = useState([])
    const [pais2, setPais2] = useState([])
    const [pais3, setPais3] = useState([])
    const [pais4, setPais4] = useState([])
 
    useEffect(() => {
        async function loadEUA() {
            const response = await api.get('/us')
            setPais1(response.data.data);
        }

        loadEUA()
    }, [])

    useEffect(() => {
      async function loadItalia() {
          const response = await api.get('/italy');
          setPais2(response.data.data);
      }

      loadItalia()
    }, [])

    useEffect(() => {
      async function loadEspanha() {
          const response = await api.get('/spain');
          setPais3(response.data.data);
      }

      loadEspanha()
    }, [])

    useEffect(() => {
        async function loadChina() {
            const response = await api.get('/china');
            setPais4(response.data.data);
        }
  
        loadChina()
    }, [])

  return (
    <div className="outros">
        <h2>Outros Pa√≠ses</h2>
        <div className="row">
            <div className="col-md col-sm-1 pais">
                        <div>
                            <h3>EUA</h3>  
                        </div> 
                        <div>
                        <span><FaCheck/></span> 
                            <strong>{pais1.confirmed}</strong> Confirmados
                        </div>
                        <div>
                        <span><FaSkull/></span> 
                            <strong>{pais1.deaths}</strong> Mortes
                        </div>
                    </div>  

            <div className="col-md col-sm-1 pais">
                        <div>
                            <h3>Espanha</h3>  
                        </div> 
                        <div>
                            <span><FaCheck/></span> 
                            <strong>{pais2.confirmed}</strong> Confirmados
                        </div>
                        <div>
                            <span><FaSkull/></span> 
                            <strong>{pais2.deaths}</strong> Mortes
                        </div>
                    </div>  

            <div className="col-md col-sm-1 pais">
                        <div>
                            <h3>Italia</h3>  
                        </div> 
                        <div>
                            <span><FaCheck/></span> 
                            <strong>{pais3.confirmed}</strong> Confirmados
                        </div>
                        <div>
                            <span><FaSkull/></span> 
                            <strong>{pais3.deaths}</strong> Mortes
                        </div>
                    </div>  

            <div className="col-md col-sm-1 pais">
                    <div>
                        <h3>China</h3>  
                    </div> 
                    <div>
                        <span><FaCheck/></span> 
                        <strong>{pais4.confirmed}</strong> Confirmados
                    </div>
                    <div>
                        <span><FaSkull/></span> 
                        <strong>{pais4.deaths}</strong> Mortes
                    </div>
                </div>
        </div>
    </div>
  );
}
